/* Global Variables */
int board[8][8];
int answer_grid [8][8];

int row_info[PICROSS_BOARD_HEIGHT][PICROSS_BOARD_HEIGHT/2];
int col_info[PICROSS_BOARD_WIDTH][PICROSS_BOARD_WIDTH/2];

volatile int pixel_buffer_start = FPGA_ONCHIP_BASE;
volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
short byte_packet[3];

int finished = 0;
int stage = 0;

#define TimerControl ((volatile int*) (TIMER_BASE+4))
#define TimerTimeoutL ((volatile int*) (TIMER_BASE+8))
#define TimerTimeoutH ((volatile int*) (TIMER_BASE+12))
#define TimerStatus ((volatile int*) (TIMER_BASE))

int main(void) {
    /* Read location of the pixel buffer from the pixel buffer controller */
    pixel_buffer_start = *pixel_ctrl_ptr;

    /* set front pixel buffer to start of FPGA On-chip memory */
    *(pixel_ctrl_ptr + 1) = 0xC8000000; // first store the address in the 
                                        // back buffer

    /* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();

    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;
    print_board(); // pixel_buffer_start points to the pixel buffer

    /* set back pixel buffer to start of SDRAM memory */
    *(pixel_ctrl_ptr + 1) = 0xC0000000;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer

    // pixel_buffer_start points to the pixel buffer
    print_board();

    // Set up first stage:
    copy_arrays(answer_grid, board1);
    initialize_grid();

    int cursor_x = 0;
    int cursor_y = 0;
    int click = 0;

    int* PS2_ptr = (int *) PS2_ADDRESS; // PS/2 port address
    int PS2_data, RVALID;

    // PS/2 mouse needs to be reset (must be already plugged in)
    *(PS2_ptr) = 0xFF;

    // Set up timer:

    // Configure the timeout period to maximum
    *(TimerTimeoutL) = 0x0a3d;
    *(TimerTimeoutH) = 0x0a3d;

    while (1) {
        print_board();
        print_boxes();
        print_numbers();

        // Print cursor:
        int x_delay = 0;
        int y_delay = 0;

        if (cursor_x > 3) {
            x_delay = 4;
        }

        for (int x = 0; x < 20; x++) {
	        for (int y = 0; y < 2; y++) {
		        plot_pixel(x + 142 + 20*cursor_x + x_delay, y*20 + 62 + 21*cursor_y, 0x0000);
            }
    	}

        for (int y = 0; y < 20; y++) {
	        for (int x = 0; x < 2; x++) {
		        plot_pixel(x*20 + 142 + 20*cursor_x + x_delay, y + 62 + 21*cursor_y, 0x0000);
            }
    	}

        wait_for_vsync(); // swap front and back buffers on VGA vertical sync
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer

        // Read data from keyboard:
        PS2_data = *(PS2_ptr); // Read the Data register in the PS/2 port
        RVALID = PS2_data & 0x8000; // Extract RVALID field

        if (RVALID) {
            byte_packet[2] = byte_packet[1];
            byte_packet[1] = byte_packet[0];
            byte_packet[0] = PS2_data & 0xFF;
        }

        if (byte_packet[1] != 240) {
            switch (byte_packet[0]) {
                case 0x1D: // W pressed
                    cursor_y--;
                    break;

                case 0x1C: // A pressed
                    cursor_x--;
                    break;

                case 0x1B: // S pressed
                    cursor_y++;
                    break;

                case 0x23: // D pressed
                    cursor_x++;
                    break;

                case 0x29: // Spacebar
                    click = 1;
                    break;
            }
        }

        if (click == 1) {
            click = 0;
            switch (board[cursor_y][cursor_x])  {
                case 0:
                    board[cursor_y][cursor_x] = 1;
                    break;
                case 1:
                    board[cursor_y][cursor_x] = -1;
                    break;
                case -1: 
                    board[cursor_y][cursor_x] = 0;
                    break;
            }
        }

        // Restrict the cursor to the screen:
        if (cursor_x < 0) {
            cursor_x = 0;
        } else if (cursor_x > 7) {
            cursor_x = 7;
        }

        if (cursor_y < 0) {
            cursor_y = 0;
        } else if (cursor_y > 7) {
            cursor_y = 7;
        }

        check_finished();
    }
}

void wait_for_vsync() {
    volatile int* pixel_ctrl_ptr = (int *) PIXEL_BUF_CTRL_BASE;
    register int status;

    *pixel_ctrl_ptr = 1;
    status = *(pixel_ctrl_ptr + 3);
    while ((status & 0x01) != 0) {
        status = *(pixel_ctrl_ptr + 3);
    }
}

void plot_pixel(int x, int y, short int line_color) {
    if (y >= 240) {
        return;
    }
    if (x >= 320) {
        return;
    }
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void clear_screen() {
    for (int x = 0; x < 320; x++) {
        for (int y = 0; y < 240; y++) {
            plot_pixel(x, y, 0x0000);
        }
    }
}

void print_boxes() {
    for (int row = 0; row < 8; row++) {
        for (int col = 0; col < 8; col++) {
            int x_delay = 0;
            int y_delay = 0;

            if (col > 3) {
                x_delay = 4;
            }

            if (row > 3) {
                y_delay = 1;
            }

            // If the current box has been selected:
            if (board[row][col] == 1) {

                // Print box:
                for (int y = 0; y < 21; y++) {
                    for (int x = 0; x < 21; x++) {
                        plot_pixel(x + 142 + 20*col + x_delay, y + 61 + 21*row + y_delay, 0x6af2);
                    }
                }
            }

            if (col > 3) {
                x_delay = 3;
            }
            if (row > 3) {
                y_delay = 4;
            }

            // If the current box has been X'ed out:
            if (board[row][col] == -1) {
                int index = 0;
                // Print X:
                for (int y = 0; y < 20; y++) {
                    for (int x = 0; x < 20; x++) {
                        if (Xed[index] != (short int)0xffff) {
                            plot_pixel(x + 142 + 20*col + x_delay, y + 63 + 20*row + y_delay, Xed[index]);
                        }
                        index++;
                    }
                }
            }
        }
    }
}

void print_board() {
    int index = 0;
    for (int y = 0; y < RESOLUTION_Y; y++) {
        for (int x = 0; x < RESOLUTION_X; x++) {
            plot_pixel(x, y, Picross_Board[index]);
            index++;
        }
    }
}

void check_finished() {
    // Check if stage is done:
    finished = 1;
    for (int y = 0; y < 8; y++) {
        for (int x = 0; x < 8; x++) {
	    if ((board[y][x] == -1) && (answer_grid[y][x] == 0)) {
		continue;
	    }
            if (board[y][x] != answer_grid[y][x]) {
                finished = 0;
            }
        }
    }

    if (finished) {
        // Clear board
        for (int y = 0; y < 8; y++) {
            for (int x = 0; x < 8; x++) {
                board[y][x] = 0;
            }
        }

        // Print finished picture
        int index = 0;
        if (stage == 0) {
            for (int y = 0; y < 165; y++) {
                for (int x = 0; x < 165; x++) {
                    plot_pixel(x + 142, y + 63, complete1[index]);
                    index++;
                }
            }
        } else if (stage == 1) {
            for (int y = 0; y < 165; y++) {
                for (int x = 0; x < 165; x++) {
                    plot_pixel(x + 142, y + 63, complete2[index]);
                    index++;
                }
            }
        } else if (stage == 2) {
            for (int y = 0; y < 165; y++) {
                for (int x = 0; x < 165; x++) {
                    plot_pixel(x + 142, y + 63, complete3[index]);
                    index++;
                }
            }
        }

        wait_for_vsync(); // swap front and back buffers on VGA vertical sync
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer

        // Change stage:
        stage++;
        if (stage > 2) {
            stage = 0;
        }

        switch (stage) {
            case 0:
                copy_arrays(answer_grid, board1);
                break;
            case 1:
                copy_arrays(answer_grid, board2);
                break;
            case 2:
                copy_arrays(answer_grid, board3);
                break;
        }
        initialize_grid();

        // Configure timer to start counting
        *(TimerControl) = 4;

        while (*(TimerStatus) != 1) {
        }

        sound(eat_buffer,eat_buf_size/2,false);
    }
}

/********************** GRIDINFO.C **********************/

void copy_arrays(int array1[8][8], int array2[8][8]){
    for(int i = 0; i< PICROSS_BOARD_WIDTH; i++){
        for(int j = 0; j <PICROSS_BOARD_HEIGHT;j++){
            array1[i][j]=array2[i][j];
        }
    }
}

void append_2D_array(int *Array, int value, int size){
    for(int index = 0; index < size; index++){
        if(Array[index] == 0){
            Array[index] = value;
            return;
        }
    }
    return; //array is full
}

void Add_to_lastElem_2D_Array(int *Array, int size){
    for(int index = 0; index < size; index++){
        if(index == size -1){
            Array[index] +=1;
            return;
        }
        else if(Array[index+1] == 0){
            Array[index] += 1;
            return;
        }
    }
    return; //array is full
}

void initialize_grid(){
    // Empty arrays:
    for (int i = 0; i < 8; i++) {
        for (int j = 0; j < 4; j++) {
            row_info[i][j] = 0;
            col_info[i][j] = 0;
        }
    }
    
    for(int row = 0; row < PICROSS_BOARD_HEIGHT; row++){
        int row_streak = 0;
        int row_info_i = 0;
        for (int col = 0; col< PICROSS_BOARD_WIDTH; col++){
            if(answer_grid[row][col] == 1){
                row_streak++;
                if (row!=0&&answer_grid[row-1][col] == 1){
                    Add_to_lastElem_2D_Array(col_info[col], PICROSS_BOARD_WIDTH/2);
                }
                else{
                    append_2D_array(col_info[col], 1, PICROSS_BOARD_WIDTH/2);
                }
            }
            else if(row_streak!=0){
                row_info[row][row_info_i] = row_streak;
                row_info_i++;
                row_streak = 0;
            }
            if(col == PICROSS_BOARD_HEIGHT-1){
                row_info[row][row_info_i] = row_streak;
            }
        }
    }
}

void print2DArray(int nrows, int ncols, int Array[nrows][ncols]){
    printf("Two Dimensional array elements:\n");
    for(int i=0; i<nrows; i++) {
        for(int j=0;j<ncols;j++) {
            printf("%d ", Array[i][j]);
            if(j== ncols-1){
                printf("\n");
            }
        }
    }
    return;
}

